/* Default */
import React from 'react'

/* Packages */
import { Box, Flex, Track, Input } from 'react-bee'

export const Form = () => {
  return (
    <Box>
      <Track>
        <h2>Form</h2>
      </Track>
      <Flex>
        <Track>
          <p>lol</p>
        </Track>
      </Flex>
    </Box>
  )
}
